import React from 'react';
import './header.scss'
import { NavLink } from 'react-router-dom';

const Header = () => {
      return (
            <header className='header'>
                  <div className='container'>
                        <ul className='header_nav'>
                              <NavLink to="/register" className='header_nav-list'>Регистрация</NavLink>
                              <Link className='header_nav-list'>о нас</Link>
                              <Link className='header_nav-list'>Привет</Link>
                              <NavLink to="/" className='header_nav-list'>Информация</NavLink>
                        </ul>
                  </div>
            </header>
      );
}

export default Header;
